import React from 'react';
import PropTypes from 'prop-types';

import useMatchingColor from '../../hooks/useMatchingColor';
import useColorCounter from '../../hooks/useColorCounter';

import './ColorCounter.css';

function ColorCounter({ color }) {
    const matchingColor = useMatchingColor(color);
    const { colorCount } = useColorCounter();
    const counter = `You clicked ${colorCount} times on ${matchingColor}`;

    console.log(colorCount);

    return (
        <p>{counter}</p>
    )
}

ColorCounter.propTypes = {
    color: PropTypes.string
};

export default ColorCounter;
